CREATE DEFINER=`DMS`@`%` PROCEDURE `GetCurrentStockBalanceFromStocks`(in plocationId int) deterministic
BEGIN
select p.Id,P.name,s.Id as stockId,floor(s.quantity/pcm.itempercase) Cases,
mod(s.quantity,pcm.itempercase) Pkts,pcm.itempercase,pr.sellingPrice,pr.price,pr.price *s.quantity StockValue
from stocks s,products p, productcasemapping pcm,pricedetails pr
where s.productId = p.Id
and s.locationId = plocationId
and pcm.Productid = p.id
and Pr.priceId = s.priceId
order by p.Name;
END ;;
