CREATE DEFINER=`DMS`@`%` PROCEDURE `GetCustomerOutstandingAmountReport`(in paramAreaId int,in paramRouteId int,in paramCustomerId int, 
													   in paramOutstandingDays int) deterministic
BEGIN
if(paramRouteId =0 and paramCustomerId = 0) then
select * from (
SELECT 
		c.Id,
		s.AddedOn,
        c.DocNo,
		c.Name,
		s.billid,
		s.RunningBillNo,
		SUM(pd.AmountPaid) AmountPaid,
		(s.BillAmount - SUM(pd.AmountPaid)) BalanceAmount,
		s.BillAmount,
        c.RouteId,
        DATEDIFF(sysdate(),s.AddedOn) DueDays,
        'S'
	FROM
		dms.PaymentDetails pd
        Inner Join sales s on (s.BillId = pd.BillId and s.customerId = pd.customerid and IFNULL(s.IsCancelled, 0) = 0 and (s.PaymentMode =1))
		Inner Join Customers c on (pd.CustomerId = c.Id and c.RouteId in(select Id from Routes where AreaId = paramAreaId))    		
	WHERE
	(paramOutstandingDays =0 or (DATEDIFF(sysdate(),s.AddedOn) >= paramOutstandingDays))	
	GROUP BY s.RunningBillNo
	HAVING round(AmountPaid) != round(s.BillAmount) and round(BalanceAmount) >=0    
 union
	 select 
		c.id,
		rcd.AddedOn,
        c.DocNo,
		c.Name,
		rcd.ChequeId,
		rcd.ChequeId,
		sum(rcp.AmountPaid),
		(cpd.Amount - SUM(rcp.AmountPaid)) BalanceAmount,
		cpd.Amount,
		0,
		DATEDIFF(sysdate(),rcd.ReturnDate) DueDays,
		'Rtn'
	 from 
		ReturnChequePayments rcp  
		inner join ReturnChequeDetails rcd on (rcd.Id = rcp.ReturnChqId)
		inner Join Customers c on(rcp.CustomerId = c.Id and c.RouteId in(select Id from Routes where AreaId = paramAreaId))
		left join ChequePaymentDetails cpd on (cpd.Id = rcd.ChequeId)
		WHERE
		(paramOutstandingDays =0 or (DATEDIFF(sysdate(),rcd.ReturnDate) >= paramOutstandingDays))
		GROUP BY rcd.ChequeId
		HAVING 0 != round(cpd.Amount) and round(BalanceAmount) >=0
) s1 order by Name;
Else
select * from
(
	SELECT 
		c.Id,
		s.AddedOn,
        c.DocNo,
		c.Name,
		s.billid,
		s.RunningBillNo,
		SUM(pd.AmountPaid) AmountPaid,
		(s.BillAmount - SUM(pd.AmountPaid)) BalanceAmount,
		s.BillAmount,
        c.RouteId,
		DATEDIFF(sysdate(),s.AddedOn) DueDays,
        'S'
	FROM
		dms.PaymentDetails pd
        Inner Join sales s on (s.BillId = pd.BillId and s.customerId = pd.customerid and IFNULL(s.IsCancelled, 0) = 0 and (s.PaymentMode =1))
		Inner Join Customers c on
			(pd.CustomerId = c.Id and (paramRouteId =0 or c.RouteId = paramRouteId) 
			and (paramCustomerId =0 or c.Id = paramCustomerId))
         
	WHERE
	(paramOutstandingDays =0 or (DATEDIFF(sysdate(),s.AddedOn) >= paramOutstandingDays))	        
	GROUP BY s.RunningBillNo
	HAVING round(AmountPaid) != round(s.BillAmount) and round(BalanceAmount) >=0	    
union
	 select 
		c.id,
		rcd.AddedOn,
        c.DocNo,
		c.Name,
		rcd.ChequeId,
		rcd.ChequeId,
		sum(rcp.AmountPaid),
		(cpd.Amount - SUM(rcp.AmountPaid)) BalanceAmount,
		cpd.Amount,
		0,
		DATEDIFF(sysdate(),rcd.ReturnDate) DueDays,
		'R'
	 from 
		ReturnChequePayments rcp  
		inner join ReturnChequeDetails rcd on (rcd.Id = rcp.ReturnChqId)
		inner Join Customers c on(rcp.CustomerId = c.Id and (paramRouteId =0 or c.RouteId = paramRouteId) and (paramCustomerId =0 or c.Id = paramCustomerId))
		left join ChequePaymentDetails cpd on (cpd.Id = rcd.ChequeId)
		WHERE
		(paramOutstandingDays =0 or (DATEDIFF(sysdate(),rcd.ReturnDate) >= paramOutstandingDays))
		GROUP BY rcd.ChequeId
		HAVING 0 != round(cpd.Amount) and round(BalanceAmount) >=0
)s2 order by Name;        
end if;
END ;;
DELIMITER ;
