CREATE DEFINER=`DMS`@`%` PROCEDURE `GetCustomerPaymentDetails`(in paramCustomerId int) deterministic
BEGIN
SELECT 
    s.billid,
    s.RunningBillNo,
    SUM(pd.AmountPaid) AmountPaid,
    (s.BillAmount - SUM(pd.AmountPaid)) BalanceAmount,
    s.BillAmount,
    s.AddedOn,
    s.PaymentMode
FROM
    dms.PaymentDetails pd,
    sales s
WHERE
    s.BillId = pd.BillId
        AND s.customerId = pd.customerid
        AND pd.customerId = paramCustomerId
        AND IFNULL(s.IsCancelled, 0) = 0
        AND s.PaymentMode !=0
GROUP BY s.RunningBillNo
HAVING AmountPaid != s.BillAmount and BalanceAmount >=0
ORDER BY s.RunningBillNo;
END ;;
DELIMITER ;
