CREATE DEFINER=`DMS`@`%` PROCEDURE `GetSalesDetailsForBillId`(IN runningBillNo integer, IN category integer) deterministic
BEGIN

declare billidValue int;

SET  billidValue = GetbillIdForCustomers(runningBillNo,category);

SELECT 
    sd.Discount AS ItemDiscount,
    pr.Price,
    p.Name,
    pcm.ItemPerCase,
    truncate(sd.Qty/pcm.ItemPerCase,0) as CaseQty,
    mod(sd.Qty,pcm.ItemPerCase) Qty,
    sd.SellingPrice,sd.productId,
    (sd.Qty * sd.SellingPrice) - IF(IsNull(sd.Discount), 0, sd.Discount) TotalAmount
FROM
    SaleDetails sd,
    PriceDetails pr,
    Products p,
    ProductCaseMapping pcm
WHERE
    sd.BillId = billidValue
And pr.PriceId = sd.PriceId
AND pr.ProductId = sd.ProductId
AND p.id = sd.ProductId
AND pcm.ProductId = p.id
order by sd.id;
END ;;
DELIMITER ;
