BEGIN

declare billidValue int;

SET  billidValue = GetbillIdForCustomers(runningBillNo,category);

SELECT 
    s.AddedOn,
    c.Name,
    s.BillReceiptNo,
    s.RunningBillNo,
    s.Discount,
    CASE
        WHEN s.PaymentMode = '0' THEN 'Cash'
        WHEN s.PaymentMode = '1' THEN 'Credit'
        ELSE 'Cheque'
    END AS PaymentMode,
    s.TotalAmount
FROM
    sales s,    
    Customers c
WHERE
 s.CustomerId = c.Id
ANd s.BillId = billidValue;

END ;;
