CREATE DEFINER=`DMS`@`%` PROCEDURE `GetSalesSummary`(IN fromSalesDate Date, IN toSalesDate date,IN categoryId int) deterministic
BEGIN
SELECT 
    *, 
    CASE
        WHEN PaymentMode = 0 THEN TotalAmount - IFNULL(ReturnAmount, 0)
        ELSE AmountPaid
    END AS 'Cash Sales',
    CASE
        WHEN PaymentMode = 1 THEN TotalAmount - IFNULL(ReturnAmount, 0) - IFNULL(AmountPaid, 0)
    END AS 'Credit Sales',
    CASE
        WHEN PaymentMode = 2 THEN ChequeAmount
    END AS 'Cheque Sales',
    TotalAmount - IFNULL(ReturnAmount, 0) AS 'Net Sales'
FROM
    salessummaryview
WHERE
    DATE(addedOn) >= fromSalesDate AND DATE(addedOn) <= toSalesDate
        AND CustomerTypeId = categoryId;
END ;;
DELIMITER ;
