CREATE DEFINER=`DMS`@`%` PROCEDURE `GetSalesSummaryReport`(in fromDate date, in toDate date) deterministic
BEGIN
DECLARE SalesCursor CURSOR FOR
	select s.BillId,s.AddedOn, c.Name,s.BillReceiptNo, s.Discount,s.TotalAmount,s.AmountPaid,s.PaymentMode 
    from sales s, customers c 
	where date(s.AddedOn) between fromDate and toDate 
    and c.Id = s.CustomerId;

Drop table IF exists `SalesSummaryReportTbl`;

CREATE temporary TABLE `SalesSummaryReportTbl` (
  `BillId` mediumint(9) ,
  `SaleDate` datetime ,
  `CustomerName` varchar(100) ,
  `ReceiptNo` varchar(20),
  `Discount` decimal,
  `ChequeSales` decimal,
  `CashSales` decimal,
  `CreditSales` decimal,
  `ReturnAmount` decimal,
  `NetSales` decimal,
  `GrossSales` decimal,
  `PaymentMode` Char
 );
 
open SalesCursor;
Begin
		DECLARE exit_flag INT DEFAULT 0;			
		DECLARE varBillId int;
        Declare varSaleDate dateTime;
		Declare varCustomerName,varReceiptNo  varchar(100); 
        Declare varDiscount,varNetSales,varAmountPaid,varChqSales,test decimal;
        DECLARE varPaymentMode char;
		DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET exit_flag = 1;
        
get_SalesLoop: LOOP
	FETCH SalesCursor INTO varBillId,varSaleDate,varCustomerName,varReceiptNo,varDiscount,varNetSales,varAmountPaid,varPaymentMode;
		IF exit_flag THEN LEAVE get_SalesLoop; END IF;
		
        Insert into SalesSummaryReportTbl(BillId,SaleDate,CustomerName,ReceiptNo,Discount,NetSales,CashSales,PaymentMode)
        values(varBillId,varSaleDate,varCustomerName,varReceiptNo,varDiscount,varNetSales,varAmountPaid,varPaymentMode);
        
		select sum(cpd.Amount) into varChqSales 
		from ChequePaymentDetails cpd,PaymentDetails pd
		where cpd.PaymentId = pd.id and pd.BillId = varBillId;

		-- select if(varPaymentMode = "2", varChqSales,0) into test;
--         select test as Test;
        select varPaymentMode ;
        
        if(varPaymentMode = '0') then
			
            select 'inside loop';
				update SalesSummaryReportTbl set CashSales = varNetSales where BillId = varBillId;
			 
         end if;
		
        
        update SalesSummaryReportTbl 
        set CreditSales = if(PaymentMode = '1',if(varAmountPaid <> 0, varNetSales - varAmountPaid,varNetSales),0) where BillId = varBillId;
        update SalesSummaryReportTbl 
        set ChequeSales = if(PaymentMode = "2", varChqSales,0) where BillId = varBillId;
        
        -- select PaymentMode;

    END LOOP get_SalesLoop;
End;
close SalesCursor;

Select * from SalesSummaryReportTbl;

END ;;
DELIMITER ;
