CREATE DEFINER=`DMS`@`%` PROCEDURE `GetStockBalanceForDate`(in dateOfStock date,in locationId int) deterministic
BEGIN

DROP TEMPORARY TABLE IF EXISTS TempStockDetailsNew;
DROP TEMPORARY TABLE IF EXISTS TempStockDetailsNewCopy;

CREATE TEMPORARY TABLE TempStockDetailsNewCopy (
  `ProductId` mediumint(9) DEFAULT NULL, 
   `quantity` decimal DEFAULT NULL,
  `ProductName` varchar(45) DEFAULT NULL,
  `CostPrice` decimal(10,2) DEFAULT NULL,
  `StockValue` decimal(10,2) DEFAULT NULL,
  `AddedOn` datetime DEFAULT NULL,
  `StockId` mediumint(9) DEFAULT NULL,
  `Rank` smallint(6) DEFAULT NULL
);

create temporary table TempStockDetailsNew
(
(
SELECT 
    id, ClosingBalance,Name,CostPrice,StockValue, AddedOn, StockId,rankNo
FROM
    (SELECT 
        p.id,
            sm.AddedOn,            
            sm.ClosingBalance,
            p.Name,
            pd.Price CostPrice,
            (sm.ClosingBalance * pd.Price) StockValue,
            sm.StockId,
            @Pid_rank:=IF(@current_Pid = p.id, @Pid_rank + 1, 1) AS rankNo,
            @current_Pid:=p.id
    FROM
        Products p, StockMovement sm, stocks s,PriceDetails pd
    WHERE
        DATE(sm.addedOn) <= dateOfStock AND s.ProductId = p.id AND sm.StockId = s.Id AND sm.FromLocation = locationId AND pd.PriceId = s.PriceId
		ORDER BY sm.stockid , DATE(sm.AddedOn) DESC) ranked
WHERE rankNo = 1)
union
(SELECT 
    p.id, s.Quantity,p.Name,pd.Price CostPrice,
            (s.Quantity * pd.Price) StockValue, s.modifiedon, s.Id,2
FROM
    Products p inner join stocks s on (s.ProductId = p.id)
	left join StockMovement sm on (sm.StockId != s.Id)
    left join PriceDetails pd on (pd.PriceId = s.PriceId)
WHERE        
	s.LocationId = locationId)
    );
 

 insert into TempStockDetailsNewCopy select * from TempStockDetailsNew;

/*select * from TempStockDetailsNew;
select * from TempStockDetailsNewCopy;*/

delete from TempStockDetailsNew where rankNo = 2 and Id in (
  select ProductId from TempStockDetailsNewCopy 
 group by productid 
 having count(productid) > 1); 
 
 select * from TempStockDetailsNew order by Name;
END ;;
DELIMITER ;
