CREATE DEFINER=`DMS`@`%` PROCEDURE `GetStockBalanceForVehicleOnDate`(in dateOfStock date,in vehicleId int) deterministic
BEGIN
SELECT 
    p.id, (stlu.LoadQuantity - ifnull(stlu.SoldQuantity,0)) ClosingBalance,p.Name, stlu.AddedOn, s.Id,1
FROM
products p inner join Stocks s on (p.id= s.productId)
		   inner Join StockLoadUnload stlu on (s.Id = stlu.StockId)
where date(stlu.AddedOn) = dateOfStock
and stlu.VehicleId = vehicleId;
END ;;
