CREATE DEFINER=`DMS`@`%` PROCEDURE `GetStockLoadUnloadingReport`(in transDate date, in vehicleId int) deterministic
BEGIN
Drop table IF exists `StkLdRpt`;
Drop table IF exists `StkLdRpt1`;
create temporary table StkLdRpt
(
SELECT 
	slu.StockId,
    p.Name,
    p.id ProductId,
    slu.OpeningBalance,
    slu.LoadQuantity,
    slu.UnLoadQuantity,
    slu.SoldQuantity,
    f.Quantity FreeIssueQty,
    pd.Price,
    pd.SellingPrice,
     -- ifnull(slu.UnLoadQuantity,0) - (ifnull(slu.OpeningBalance,0) + ifnull(rtn.Quantity,0) + ifnull(slu.LoadQuantity,0) - ifnull(sm.outward,0)) -  
     -- ifnull(slu.SoldQuantity,0) - ifnull(f.Quantity,0) Difference,
	
     ( ifnull(slu.UnLoadQuantity,0)  - ((ifnull(slu.OpeningBalance,0) + ifnull(rtn.Quantity,0) + ifnull(slu.LoadQuantity,0) - ifnull(sm.TransferredQty,0)) 
     - ifnull(slu.SoldQuantity,0) - ifnull(f.Quantity,0) )) Difference,
    slu.addedOn,
    rtn.Quantity UsableReturn,
    sm.TransferredQty TransferQty
FROM
    StockLoadUnload slu 
    Inner join Stocks s on (slu.StockId = s.Id)
    Inner Join PriceDetails pd  on (pd.PriceId = s.PriceId)
    inner Join Products p on (p.Id = s.ProductId)
    left outer join FreeIssues f on (f.ProductId = p.Id and f.PriceId = pd.PriceId and f.VehicleId = vehicleId and date(f.AddedOn)= transDate)  
    left outer join SalesReturn rtn on (rtn.ProductId = p.Id and rtn.ReturnReasonCode =5 and date(rtn.createdOn) = transDate and rtn.vehicleId = vehicleId)
    left outer Join StockMovement sm on (slu.stockId = sm.stockId and sm.FromVehicleLocation = vehicleId and Date(sm.AddedOn) =transDate  )
WHERE    
		DATE(slu.AddedOn) = transDate
        AND slu.VehicleId = vehicleId      
);

-- select * from  StkLdRpt;
create temporary table StkLdRpt1
(
select
	0 StockId,
    p.Name,
    p.id ProductId,    
    0 OpeningBalance,
    0 LoadQuantity,
    0 UnLoadQuantity,
    0 SoldQuantity,
    0 FreeIssueQty,
    pd.Price,
    pd.SellingPrice,
	ifnull(rtn.Quantity,0) Difference,
    rtn.CreatedOn,
    rtn.Quantity,
    0 TransferQty
    from  SalesReturn rtn, products p,PriceDetails pd
    where 
		rtn.vehicleId = vehicleId and rtn.ProductId = p.Id and rtn.ReturnReasonCode =5 and pd.PriceId = rtn.PriceId
        and date(rtn.CreatedOn) = transDate and P.id Not in (select ProductId from StkLdRpt)
);

select * from (
select * from  StkLdRpt
union
select * from  StkLdRpt1
) t order by t.Name
;
END ;;
